import Day from "./../Date/Date"; 
import {useState} from 'react'; 
import "./Calendar.css"; 

export default function Calendar () {

    const monthNames = ["January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"];

    let month = []; 

    let [curr, setDate] = useState(new Date(Date.now())); 

    console.log(curr); 

    var currMonth = curr.getMonth();

    Calendar.currMonth = currMonth; 

    //month.push(curr); 

    while(curr.getMonth() === currMonth || curr.getDay() > 0) {
         month.unshift(new Date(curr)); 
         curr.setDate(curr.getDate() - 1); 
    }

    month.unshift(new Date(curr)); 

    curr = new Date(Date.now()); 

    while(curr.getMonth() === currMonth || curr.getDay() < 6) {
        curr.setDate(curr.getDate() + 1); 
        month.push(new Date(curr)); 
    }

    while(month.length < 42) {
        curr.setDate(curr.getDate() + 1); 
        month.push(new Date(curr)); 
    }

    console.log(curr.getMonth); 



    let monthIndex = 0; 

    return (
        <div >
            <p id="month-text"> {monthNames[currMonth]}</p>

            <div id="with-buttons">

                <button id = "left-arrow" onClick= {() => {setDate(curr.setMonth(curr.getMonth() + 1))}}>
                        <i className="fa fa-arrow-left"></i>
                </button>

                <table>
                    <thead>
                        <td>S</td>
                        <td>M</td>
                        <td>T</td>
                        <td>W</td>
                        <td>Th</td>
                        <td>F</td>
                        <td>Sa</td>
                    </thead>
                    <tbody>
                        <tr>
                            <td><Day date={month[monthIndex++]}></Day></td>
                            <td><Day date={month[monthIndex++]}></Day></td>
                            <td><Day date={month[monthIndex++]}></Day></td>
